async function update({ PK, SK, layername }, params) {
  // const p = await TLands.get({ PK, SK });
  // console.log(p);
  // return;
  console.log({ PK, SK, params });
  //return;
  const updateProject = await TLands.update({ PK, SK }, { $SET: params });
  console.log("--------dynamodb updated---------");
  await geoserverWFST(layername, "plotid", updateProject.id, {
    pname: updateProject.plotName,
    area: updateProject.plotAreaDetails.area,
    //the_geom: `<gml:MultiPolygon srsName="EPSG:4326"><gml:polygonMember><gml:Polygon><gml:exterior><gml:LinearRing><gml:posList>${updateProject.plotGeoDataReference.geom}</gml:posList></gml:LinearRing></gml:exterior></gml:Polygon></gml:polygonMember></gml:MultiPolygon>`
    price: updateProject.plotPrice,
    // dimension: updateProject.plotAreaDetails.dimension,
    plottype: updateProject.plotGeoDataReference.plotType,
  });
}

